import React from 'react';
import styles from './index.module.css';
import changingElemReducer from '../../../reducers/activities/changingElem'
import {createStore} from 'redux'
import {Provider} from 'react-redux'
import ChangingElemFrame from '../ChangingElem/ChangingElemFrame/ChangingElemFrame'


function ChangingElem() {
    const store = createStore(changingElemReducer, {rating: 1, category: ""})

    let color;
    switch (store.category) {
        case "active":
            color = '#8797EB';
            break;
        case "collective":
            color = '#6FCF97';
            break;
        case "outdoors":
            color = '#BB6BD9';
            break;
        default:
            color = '#BB6BD9';    
    }
    return (
        <Provider store={store}>
            <div className={styles.container}>
                <ChangingElemFrame/>
            </div>
        </Provider>
    )
}

export default ChangingElem
